import { NavLink } from "react-router-dom";
import logo from "../../assets/logo.png";
import "./layout.css";

function Header() {
  return (
    <header className="header">
      <img src={logo} className="header-logo" alt="logo" />
      <nav className="header-nav">
        <NavLink to="/" className={(isActive) => "active_link" + (!isActive ? " unselected" : "")}>
          Accueil
        </NavLink>

        <NavLink to="/about" className={(isActive) => "active_link" + (!isActive ? " unselected" : "")}>
          A Propos
        </NavLink>
      </nav>
    </header>
  );
}

export default Header;
